Enter the letter of the graph of $y = f^{-1}(x).$
Answer:

output:
The graph of $y = f^{-1}(x)$ is the graph of $y = f(x)$ reflected across the line $y = x.$  The graph of $y = f(x)$ is shown below.

[asy]
unitsize(0.5 cm);

real func(real x) {
  return (log(x));
}

path foo = graph(func,exp(-5),5); 

for (n = 1; n <= 5; ++n) {
  draw(foo,graf[n],red);
}

