Question: In the diagram below, points $A$, $B$, $C$, and $P$ are situated so that $PA=2$, $PB=3$, $PC=4$, and $BC=5$. What is the maximum possible area of $\triangle ABC$? [asy]
defaultpen(linewidth(0.8)); size(150);
