Answer:

output:
Let $P(x,y)$. Then $AP = \sqrt{x^2 + y^2}$ and $BP = \sqrt{x^2 + y^2 + 9}$. We want to find $x$ such that $x^2 + y^2 = 10$ and $x^2 + y^2 + 9 = 13$. Solving the first equation for $y$ gives $y = \pm \sqrt{10 - x^2}$. Substituting this into the second equation gives $x^2 + 9 + 2 \sqrt{10 - x^2} = 13$. This simplifies to $x^2 + 2 \sqrt{10 - x^2} = 4$. Squaring both sides gives $x^4 + 4x^2 (10 - x^2) + 40 - 4x^2 = 16$. This simplifies to $x^4 - 4x^2 + 40 = 0$. This factors as $(x^2 - 2)^2 + 36 = 0$. Since $(x^2 - 2)^2 \ge 0$, this is impossible. Therefore, $P$ is not on the line $AP = \sqrt{10}$.

