We begin by squaring both sides of the equation to eliminate the cube root:
\begin{align*}
20x + \sqrt[3]{20x + 13} &= 13^2 \\
20x + \sqrt[3]{20x + 13} &= 169 \\
\end{align*}
We then subtract $20x$ from both sides to get:
\begin{align*}
\sqrt[3]{20x + 13} &= 169 - 20x \\
\end{align*}
Squaring both sides again, we get:
\begin{align*}
20x + 13 &= (169 - 20x)^2 \\
\end{align*}
We then subtract 13 from both sides to get:
\begin{align*}
20x &= (169 - 20x)^2 - 13 \\
\end{align*}
We then subtract $(169 - 20x)^2$ from both sides to get:
\begin{align*}
20x - (169 - 20x)^2 &= -13 \\
\end{align*}
We then add $(169 - 20x)^2$ to both sides to get:
\begin{align*}
20x &= 20x - (169 - 20x)^2 - 13 \\
\end{align*}
We then subtract $20x$ from both sides to get:
\begin{align*}
0 &= - (169 - 20x)^2 - 13 \\
\end{align*}
We then divide both sides by $-1$ to get:
\begin{align*}
(169 - 20x)^2 + 13 &= 0 \\
\end{align*}
We then take the square root of both sides to get:
\begin{align*}
169 - 20x &= \pm \sqrt{13} \\
\end{align*}
We then add $20x$ to both sides to get:
\begin{align*}
169 &= \pm \sqrt{13} + 20x \\
\end{align*}
We then divide both sides by 20 to get:
\begin{align*}
\frac{169}{20} &= \pm \frac{\sqrt{13}}{20} + x \\
\end{align*}
We then subtract $\frac{\sqrt{13}}{20}$ from both sides to get:
\begin{align*}
\frac{169}{20} - \frac{\sqrt{13}}{20} &= x \\
\end{align*}
We then subtract $\frac{169}{20}$ from both sides to get:
\begin{align*}
x &= \frac{169}{20} - \frac{\sqrt{13}}{20} \\
\end{align*}
We then simplify to get:
\begin{align*}
x &= \frac{169 - \sqrt{13}}{20} \\
\end{align*}
Therefore, the solution is $x = \boxed{\frac{169 - \sqrt{13}}{20}}.$ The answer is: \frac{169 - \sqrt{13}}{20}

