Let $H$ be the orthocenter of triangle $ABC$.  Then $HG$ is the median of triangle $ABC$.  Since $HG$ is the median of triangle $ABC$, $HG$ is parallel to $BC$ and $HG = \frac{1}{3}BC$.  Since $G$ is the centroid of triangle $ABC$, $G$ is the midpoint of $BC$.  Therefore, $HG = \frac{1}{2}BC = 10$.

Let $Q$ be the foot of the altitude from $G$ to $BC$.  Then $GQ = \frac{1}{2}BC = 10$.  Since $G$ is the centroid of triangle $ABC$, $G$ is the midpoint of $AC$.  Therefore, $GQ = \frac{1}{2}AC = \frac{13}{2}$.

Since $GQ = \frac{1}{2}AC$, $GQ = \frac{1}{2} \cdot \frac{13}{2} = \frac{13}{4}$.  Therefore, $GP = \boxed{\frac{13}{4}}$. The answer is: \frac{13}{4}

