Let $f(x) = ax^2 + bx + c.$ Then
\[f(x) f(-x) = a(-x)^2 + b(-x) + c = ax^2 - bx + c.\]Also,
\[f(x^2) = a(x^2)^2 + b(x^2) + c = ax^4 + bx^2 + c.\]Hence,
\[ax^4 + bx^2 + c = ax^2 - bx + c.\]This simplifies to $ax^4 - 2bx^2 + (a + b)x + c = 0.$

If $a = 0,$ then $b = 0.$  If $a \neq 0,$ then $b = 0.$  If $a = 0$ and $b = 0,$ then $c = 0.$  If $a = 0,$ $b = 0,$ and $c = 0,$ then $f(x) = 0$ for all $x,$ so $f(x) = 0$ for all $x.$

