If $a \neq 0,$ $b \neq 0,$ $c \neq 0,$ then $f(x) = \frac{a}{b} x + \frac{c}{b}.$  If $a = 0,$ $b \neq 0,$ $c \neq 0,$ then $f(x) = \frac{c}{b} x.$  If $a \neq 0,$ $b = 0,$ $c \neq 0,$ then $f(x) = \frac{a}{c} x.$  If $a = 0,$ $b = 0,$ $c \neq 0,$ then $f(x) = \frac{c}{b} x.$  If $a \neq 0,$ $b \neq 0,$ $c = 0,$ then $f(x) = \frac{a}{b} x.$  If $a = 0,$ $b = 0,$ $c = 0,$ then $f(x) = 0.$

