Question: A $30^\circ$-$60^\circ$-$90^\circ$ triangle is drawn on the exterior of an equilateral triangle so the hypotenuse of the right triangle is one side of the equilateral triangle. If the shorter leg of the right triangle is 6 units, what is the distance between the two vertices that the triangles do not have in common? Express your answer in simplest radical form. [asy]
draw((2,0)--(0,0)--(1,1.732)--(2,1.732)--(2,0)--(1,1.732));
draw((2,1.632)--(1.9,1.632)--(1.9,1.732));
label("$60^\circ$",(1,1.732),2SE+E);
label("$30^\circ$",(2,0),5NNW+4N);
label("6",(1.5,1.732),N);
[/asy]
Answer:

output:
Let $x$ be the distance between the two vertices that the triangles do not have in common. Then, the distance between the two vertices of the equilateral triangle is $x\sqrt{3}$. The hypotenuse of the right triangle is $6$ units, so the other leg of the right triangle is $\frac{6}{\sqrt{2}}$ units. By the Pythagorean Theorem, we have \[
x^2 + \left(\frac{6}{\sqrt{2}}\right)^2 = \left(x\sqrt{3}\right)^2.
\] Solving for $x$, we find $x = \boxed{2\sqrt{2}}$. The answer is: 2\sqrt{2}

