Let $a$ be the first term and $r$ be the common ratio.  Then
\begin{align*}
a + ar + ar^2 + ar^3 + \dotsb &= 15 \\
a + a^2 + a^3 + a^4 + \dotsb &= 45
\end{align*}Subtracting the first equation from the second, we get
\begin{align*}
a^2 + a^3 + a^4 + \dotsb &= 30 \\
a + a^2 + a^3 + a^4 + \dotsb &= 45 \\
\Rightarrow \qquad a^2 + a^3 + a^4 &= 30 \\
\Rightarrow \qquad a^2 (1 + r + r^2) &= 30 \\
\Rightarrow \qquad a^2 &= \frac{30}{1 + r + r^2} \\
\Rightarrow \qquad a &= \sqrt{\frac{30}{1 + r + r^2}}
\end{align*}Since $a$ is the first term, $r$ must be negative.  Then
\begin{align*}
a &= \sqrt{\frac{30}{1 - r + r^2}} \\
&= \sqrt{\frac{30}{1 - r^3}} \\
&= \sqrt{\frac{30}{1 - (-1)^3}} \\
&= \sqrt{30}
\end{align*}Therefore, the first term is $\boxed{\sqrt{30}}$. The answer is: \sqrt{30}

We have $\cos 5 \theta = \cos (2 \cdot 2 \theta) = \cos^2 2 \theta - \sin^2 2 \theta = (\cos^2 2 \theta - \sin^2 2 \theta) - \sin^2 2 \theta = \cos^2 2 \theta - 2 \sin^2 2 \theta.$

We know that $\cos^2 \theta + \sin^2 \theta = 1.$  Hence, $\cos^2 2 \theta = 1 - \sin^2 2 \theta.$  Thus, $\cos 5 \theta = \cos^2 2 \theta - 2 \sin^2 2 \theta = (1 - \sin^2 2 \theta) - 2 \sin^2 2 \theta = 1 - 3 \sin^2 2 \theta.$

We know that $\sin 2 \theta = 2 \sin \theta \cos \theta.$  Hence, $\sin^2 2 \theta = \sin^2 \theta \cos^2 \theta = \frac{1}{4} \sin^2 \theta.$  Thus, $\cos 5 \theta = 1 - 3 \sin^2 2 \theta = 1 - 3 \cdot \frac{1}{4} \sin^2 \theta = \boxed{\frac{5}{4}}.$ The answer is: \frac{5}{4}

